import React from "react";
import Chart from "react-apexcharts";

export const TestChart = () => {
  const chartOptions = {
    chart: {
      id: "bar-chart",
    },
    xaxis: {
      categories: [
        "Січень",
        "Лютий",
        "Березень",
        "Квітень",
        "Травень",
        "Червень",
      ],
    },
  };

  const chartSeries = [
    {
      name: "Продажі",
      data: [30, 40, 35, 50, 49, 60],
    },
  ];

  return (
    <Chart
      style={{ backgroundColor: "rgb(94 53 177 0.4)", borderRadius: "12px" }}
      options={chartOptions}
      series={chartSeries}
      type="bar"
      height={"100%"}
    />
  );
};
